import {EComponentGroupTitle, EComponentTitle, TComponentGroup} from "~/interfaces/material_components";

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: EComponentGroupTitle.DATA_DISPLAY,
  components: [
    { title: EComponentTitle.AVATAR, props: [] },
    { title: EComponentTitle.BADGE, props: [] },
    { title: EComponentTitle.CHIP, props: [] },
    { title: EComponentTitle.DIVIDER, props: [] },
    { title: EComponentTitle.ICONS, props: [] },
    { title: EComponentTitle.MATERIAL_ICONS, props: [] },
    { title: EComponentTitle.LIST, props: [] },
    { title: EComponentTitle.TABLE, props: [] },
    { title: EComponentTitle.TOOLTIP, props: [] },
    { title: EComponentTitle.TYPOGRAPHY, props: [] }
  ]
};

export default componentGroup;
